import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'CredibancoTechTest';
}
<div style="text-align:center,margin-up:100p">
  <img width="350" alt="Main logo" src="assets/data/logo.png">
  <h1>
    Welcome to {{ title }}
  </h1>
</div>
<div class="container">
  <button class="btn btn-info">Consultar Tarjeta</button>
</div>
